#include "utilities.h"

#include <stdio.h>
#include <stdlib.h>
#include "perft_manager.h"
#define MAX_LINE_LENGTH 1024

int ReadFileLineByLine(char *filePath)
{
    FILE *file;
    char line[MAX_LINE_LENGTH];

    // Open the file in read mode
    file = fopen("/home/gb/My/MollyChessBot/src/tests/data-files/perft-marcel.epd", "r");
    if (file == NULL)
    {
        perror("Error opening file");
        return EXIT_FAILURE;
    }

    // Read each line and print it
    while (fgets(line, sizeof(line), file))
    {
        // Print the line
        printf("%s,", line);
    }
    printf("\n");
    // Close the file
    fclose(file);

    return EXIT_SUCCESS;
}

